import './../App.css';


export default function Footer() {
    return(
        <div>
            <span> Site designed and made by Hannah Gross </span>
            <span> <a href="https://github.com/hannahmanuela/personal_website" target="_blank"> Source </a>   </span>
            <span> <a href={process.env.PUBLIC_URL + '/CV-Hannah-Gross.pdf'} target = "_blank"> resume.pdf </a> </span>
            <br/>
            <span> hannah_gross@brown.edu </span>
            <span> https://www.linkedin.com/in/hannah-mn-gross/ </span>
            <span> https://github.com/hannahmanuela </span>
        </div>
    )
}
